// components/TimeoutPopup.tsx
import React from "react";
import "../users/styles/timeout_popup.css";

interface TimeoutPopupProps {
  onClose: () => void;
  onRedirect: () => void;
  message: string;
}

const TimeoutPopup: React.FC<TimeoutPopupProps> = ({ onClose, onRedirect }) => {
  return (
    <div className="popup-backdrop">
      <div className="popup-container">
        <h2>⏳ Time’s Up!</h2>
        <p>Your booking session has expired. Please book again.</p>
        <div className="popup-controls">
          <button className="confirm-button" onClick={onRedirect}>
            Back to Home
          </button>
          <button className="edit-button" onClick={onClose}>
            Stay Here
          </button>
        </div>
      </div>
    </div>
  );
};

export default TimeoutPopup;
